import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
} from 'react-router-dom';
import './App.css';
import Header from './components/nav/navbar';
import CompaniesList from './components/list/FinancialList';
import CompanyDetails from './components/details/FinancialDetails'; // Make sure you import CompanyDetails

function App() {
  return (
    <BrowserRouter>
      <Header />
      {' '}
      {/* Include the Header component */}
      <Switch>
        <Route exact path="/" component={CompaniesList} />
        <Route path="/company/:symbol" component={CompanyDetails} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
